import Vue from 'vue'
import  Router  from 'vue-router'
import homePage from './homePage'
import loginPage from './loginPage'
Vue.use(Router)
export default {
    routes: [
        {path :'/',component :homePage,
         path :'/login',component :loginPage,
         path:'/registration',component:loginPage
    }
    ]
}
